import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import L from 'leaflet';
import './App.css';
import fetchData from './Server/sgAPI';

import 'leaflet/dist/leaflet.css';

const App = () => {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDataFromApi = async () => {
      try {
        const result = await fetchData();
        setData(result);
      } catch (error) {
        setError(error);
      }
    };

    fetchDataFromApi();
    console.log(data);
  }, []);

  const defaultCenter = [1.290, 103.851];
  const defaultZoom = 11;

  const customIcon = new L.Icon({
    iconUrl: 'path-to-your-custom-marker-icon.png', // replace with the path to your custom marker icon
    iconSize: [32, 32],
    iconAnchor: [16, 32],
    popupAnchor: [0, -32],
  });

  return (
    <div className="App">
      {error && <p>Error: {error.message}</p>}
      {data && (
        <MapContainer center={defaultCenter} zoom={defaultZoom}>
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution="&copy; <a href=&quot;https://www.openstreetmap.org/copyright&quot;>OpenStreetMap</a> contributors"
          />
          <Marker position={[data.latitude, data.longitude]} icon={customIcon}>
            <Popup>
              <div>
                <p>Details: {data.details}</p>
              </div>
            </Popup>
          </Marker>
        </MapContainer>
      )}
    </div>
  );
};

export default App;
